fields.description:
Hello!

We are looking for an ambitious and independent Senior Data Analyst who will set up and then manage our data infrastructure according to the modern data stack in the new B2C product (as part of Genesis ecosystem) in the travel & telecommunication market.


 Work format: Possibility to work fully remotely or from our offices in Warsaw or Kyiv




    We are a mobile and web application (Web, iOS, Android) that enables easy and fast purchases of mobile data packages in any country in the world, leveraging eSIM technology;
    Our product allows seamless use of internet services while traveling at rates much lower than roaming and without having to search for local operators or purchase physical SIM cards;
    With grand ambitions, we aim to evolve our services into a comprehensive Travel App that caters to all travel-related needs, making every journey smoother.


Your tasks:

    Set up data infrastructure almost from the scratch and decide on key cornerstones;
    Create and manage dynamic (and later on personalized) pricing logic;
    Collaborate with Marketing and Product to support decision-making and drive insights, user acquisition and revenue growth (including creating dashboards);
    Collaborate with the CEO to find actionable insights and support strategic-making decisions;
   Design, optimize, and execute A/B testing for product, marketing and pricing needs.
